DROP VIEW IF EXISTS `tv_withoutpayleaveallcount2019`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `tv_withoutpayleaveallcount2019` AS select count(`lar_data`.`className`) AS `withoutpayLeaveAllCount2019` from `lar_data` where `lar_data`.`className` = 'label-dark' and `lar_data`.`start` >= 1546300800 and `lar_data`.`start` < 1577836800;
